import React from "react";
import { Segment } from "semantic-ui-react";
import Header from "../components/Header";

const fun = () => {
  return (
    <div
      style={{
        backgroundImage: `url('https://bafybeiatwzk364loks3vjnx42aio4d3vpxvklk5tbtfcyd6ywmemxrcvtq.ipfs.infura-ipfs.io/')`,
        height: "300px",
        margin: "0px",
      }}
    >
      <link
        rel="stylesheet"
        href="https://cdnjs.cloudflare.com/ajax/libs/semantic-ui/2.4.1/semantic.min.css"
        integrity="sha512-8bHTC73gkZ7rZ7vpqUQThUDhqcNFyYi2xgDgPDHc+GXVGHXq+xPjynxIopALmOPqzo9JZj0k6OqqewdGO3EsrQ=="
        crossOrigin="anonymous"
      />
      <Header />
    </div>
  );
};

export default fun;
//ethereum.autoRefreshOnNetworkChange
//https://docs.metamask.io/guide/ethereum-provider.html#ethereum-autorefreshonnetworkchange
